TfLiteStatus mobilenet_invoke() {

  tflite::ops::micro::resetStaticDataCounters();

  for(size_t i = 0; i < 31; ++i) {
    TfLiteStatus status = registrations[nodeData[i].used_op_index].invoke(&ctx, &tflNodes[i]);
    if (status != kTfLiteOk) {
      return status;
    }
  }
  return kTfLiteOk;
}

